formatTools.code:
function formatTools(tools) {
    if(!Array.isArray(tools)) return tools;

    return tools.map(tool => {
        const func = tool["function"];
        if (!func || !func["arguments"]) return tool;

        try {
            func["arguments"] = JSON.parse(iml.get(func, "arguments"));
        } catch(e) {
            throw new Error("The field argument in the tool array is not valid JSON.");
        }

        return tool;
    });
}

formatTools.test:
it('should return non array input as is', () => {
    assert.strictEqual(formatTools(null), null);
    assert.deepEqual(formatTools({ key: 'value' }), { key: 'value' });
});

