function generateImageName(contentType) {
    const mimeToExt = {
        "image/jpeg": "jpg",
        "image/png": "png",
        "image/gif": "gif",
        "image/webp": "webp",
        "image/svg+xml": "svg"
    };
    const ext = mimeToExt[contentType];
    return ext ? `output.${ext}` : null;
}

